import React from 'react';
import manishPhoto from '../images/photo.jpg';

const Home = () => {
	return (
		<div>
			<header className="App-header">
				<div className='row'>
					<div className='box-cell box1'>
						<img alt="Manish" src={manishPhoto} width="200" height="200"/>
					</div>
					<div className='box-cell box2'><p>I am a computer science major at the University of Texas at Dallas!</p></div>
				</div>
			</header>
		</div>
	);
};

export default Home;
